import React from 'react';


function Home() {
    return (
        <>
            <div className="container-fluid" id="navbar">
                <div className="row">
                    <div className="col-10 mx-auto">
                    <h1>Welcome to Our Shop</h1>
                    <p>Here We provide a unique variety ofcosmetics to glaour ourself</p>
                </div>
                </div>
            </div>
        </>
    );
}
export default Home;
